import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../CSS Sheets/ResultsPage.css';

interface ResultData {
    card: string;
    id: string;
    card_count: string;
    Ungraded: string;
    'Grade 1': string;
    'Grade 2': string;
    'Grade 3': string;
    'Grade 4': string;
    'Grade 5': string;
    'Grade 6': string;
    'Grade 7': string;
    'Grade 8': string;
    'Grade 9': string;
    'Grade 9.5': string;
    'SGC 10': string;
    'CGC 10': string;
    'PSA 10': string;
    'BGS 10': string;
    'BGS 10 Black': string;
    'CGC 10 Pristine': string;
    final_link: string;
}

const ResultsPage: React.FC = () => {
    const [results, setResults] = useState<ResultData[]>([]);
    const [error, setError] = useState<string | null>(null);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchResults = async () => {
            try {
                const response = await fetch('http://localhost:8000/results');
                if (!response.ok) {
                    throw new Error('Failed to fetch results');
                }
                const data = await response.json();
                // Extract the results from the response
                const formattedResults: ResultData[] = [];
                const length = Object.keys(data.results.card).length;

                for (let i = 0; i < length; i++) {
                    formattedResults.push({
                        card: data.results.card[i],
                        id: data.results.id[i],
                        card_count: data.results.card_count[i],
                        Ungraded: data.results.Ungraded[i],
                        'Grade 1': data.results['Grade 1'][i],
                        'Grade 2': data.results['Grade 2'][i],
                        'Grade 3': data.results['Grade 3'][i],
                        'Grade 4': data.results['Grade 4'][i],
                        'Grade 5': data.results['Grade 5'][i],
                        'Grade 6': data.results['Grade 6'][i],
                        'Grade 7': data.results['Grade 7'][i],
                        'Grade 8': data.results['Grade 8'][i],
                        'Grade 9': data.results['Grade 9'][i],
                        'Grade 9.5': data.results['Grade 9.5'][i],
                        'SGC 10': data.results['SGC 10'][i],
                        'CGC 10': data.results['CGC 10'][i],
                        'PSA 10': data.results['PSA 10'][i],
                        'BGS 10': data.results['BGS 10'][i],
                        'BGS 10 Black': data.results['BGS 10 Black'][i],
                        'CGC 10 Pristine': data.results['CGC 10 Pristine'][i],
                        final_link: data.results.final_link[i],
                    });
                }
                setResults(formattedResults);
            } catch (err) {
                setError((err as Error)?.message || 'An unknown error occurred');
                console.error('Error fetching results:', err);
            }
        };

        fetchResults();
    }, []);

    const convertToCSV = (data: ResultData[]) => {
        const header = [
            'Card',
            'ID',
            'Card Count',
            'Ungraded',
            'Grade 1',
            'Grade 2',
            'Grade 3',
            'Grade 4',
            'Grade 5',
            'Grade 6',
            'Grade 7',
            'Grade 8',
            'Grade 9',
            'Grade 9.5',
            'SGC 10',
            'CGC 10',
            'PSA 10',
            'BGS 10',
            'BGS 10 Black',
            'CGC 10 Pristine',
            'Final Link',
        ].join(',');

        const rows = data.map(item => [
            item.card,
            item.id,
            item.card_count,
            item.Ungraded,
            item['Grade 1'],
            item['Grade 2'],
            item['Grade 3'],
            item['Grade 4'],
            item['Grade 5'],
            item['Grade 6'],
            item['Grade 7'],
            item['Grade 8'],
            item['Grade 9'],
            item['Grade 9.5'],
            item['SGC 10'],
            item['CGC 10'],
            item['PSA 10'],
            item['BGS 10'],
            item['BGS 10 Black'],
            item['CGC 10 Pristine'],
            item.final_link,
        ].join(',')).join('\n');

        return `${header}\n${rows}`;
    };

    const downloadCSV = () => {
        const csvData = convertToCSV(results);
        const blob = new Blob([csvData], { type: 'text/csv;charset=utf-8;' });
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.setAttribute('download', 'results.csv');
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

    const goHome = () => {
        navigate('/'); // Navigate to the root path
    };

    // Function to calculate totals for each grade category
    const calculateTotals = (results) => {
        return results.reduce(
            (acc, item) => {
                const count = item.card_count || 0; // Ensure we handle cases where card_count might be null
    
                acc.card_count += count;
                acc.Ungraded += (item.Ungraded || 0) * count;
                acc['Grade 1'] += (item['Grade 1'] || 0) * count;
                acc['Grade 2'] += (item['Grade 2'] || 0) * count;
                acc['Grade 3'] += (item['Grade 3'] || 0) * count;
                acc['Grade 4'] += (item['Grade 4'] || 0) * count;
                acc['Grade 5'] += (item['Grade 5'] || 0) * count;
                acc['Grade 6'] += (item['Grade 6'] || 0) * count;
                acc['Grade 7'] += (item['Grade 7'] || 0) * count;
                acc['Grade 8'] += (item['Grade 8'] || 0) * count;
                acc['Grade 9'] += (item['Grade 9'] || 0) * count;
                acc['Grade 9.5'] += (item['Grade 9.5'] || 0) * count;
                acc['SGC 10'] += (item['SGC 10'] || 0) * count;
                acc['CGC 10'] += (item['CGC 10'] || 0) * count;
                acc['PSA 10'] += (item['PSA 10'] || 0) * count;
                acc['BGS 10'] += (item['BGS 10'] || 0) * count;
                acc['BGS 10 Black'] += (item['BGS 10 Black'] || 0) * count;
                acc['CGC 10 Pristine'] += (item['CGC 10 Pristine'] || 0) * count;
    
                return acc;
            },
            {
                card_count: 0,
                Ungraded: 0,
                'Grade 1': 0,
                'Grade 2': 0,
                'Grade 3': 0,
                'Grade 4': 0,
                'Grade 5': 0,
                'Grade 6': 0,
                'Grade 7': 0,
                'Grade 8': 0,
                'Grade 9': 0,
                'Grade 9.5': 0,
                'SGC 10': 0,
                'CGC 10': 0,
                'PSA 10': 0,
                'BGS 10': 0,
                'BGS 10 Black': 0,
                'CGC 10 Pristine': 0,
            }
        );
    };
    

    const totals = calculateTotals(results);

    return (
        <div className="results-page">
            <h1>Results</h1>
            {error && <p className="error">{error}</p>}
            <table>
                <thead>
                    <tr>
                        <th>Card</th>
                        <th>ID</th>
                        <th>Card Count</th>
                        <th>Ungraded</th>
                        <th>Grade 1</th>
                        <th>Grade 2</th>
                        <th>Grade 3</th>
                        <th>Grade 4</th>
                        <th>Grade 5</th>
                        <th>Grade 6</th>
                        <th>Grade 7</th>
                        <th>Grade 8</th>
                        <th>Grade 9</th>
                        <th>Grade 9.5</th>
                        <th>SGC 10</th>
                        <th>CGC 10</th>
                        <th>PSA 10</th>
                        <th>BGS 10</th>
                        <th>BGS 10 Black</th>
                        <th>CGC 10 Pristine</th>
                        <th>Final Link</th>
                    </tr>
                </thead>
                <tbody>
                    {results.map((item, index) => (
                        <tr key={index}>
                            <td>{item.card}</td>
                            <td>{item.id}</td>
                            <td>{item.card_count}</td>
                            <td>{item.Ungraded}</td>
                            <td>{item['Grade 1']}</td>
                            <td>{item['Grade 2']}</td>
                            <td>{item['Grade 3']}</td>
                            <td>{item['Grade 4']}</td>
                            <td>{item['Grade 5']}</td>
                            <td>{item['Grade 6']}</td>
                            <td>{item['Grade 7']}</td>
                            <td>{item['Grade 8']}</td>
                            <td>{item['Grade 9']}</td>
                            <td>{item['Grade 9.5']}</td>
                            <td>{item['SGC 10']}</td>
                            <td>{item['CGC 10']}</td>
                            <td>{item['PSA 10']}</td>
                            <td>{item['BGS 10']}</td>
                            <td>{item['BGS 10 Black']}</td>
                            <td>{item['CGC 10 Pristine']}</td>
                            <td>{item.final_link}</td>
                        </tr>
                    ))}
                    <tr>
                        <td colSpan={2}><strong>Totals:</strong></td>
                        <td>{totals.card_count}</td>
                        <td>${totals.Ungraded.toFixed(2)}</td>
                        <td>${totals['Grade 1'].toFixed(2)}</td>
                        <td>${totals['Grade 2'].toFixed(2)}</td>
                        <td>${totals['Grade 3'].toFixed(2)}</td>
                        <td>${totals['Grade 4'].toFixed(2)}</td>
                        <td>${totals['Grade 5'].toFixed(2)}</td>
                        <td>${totals['Grade 6'].toFixed(2)}</td>
                        <td>${totals['Grade 7'].toFixed(2)}</td>
                        <td>${totals['Grade 8'].toFixed(2)}</td>
                        <td>${totals['Grade 9'].toFixed(2)}</td>
                        <td>${totals['Grade 9.5'].toFixed(2)}</td>
                        <td>${totals['SGC 10'].toFixed(2)}</td>
                        <td>${totals['CGC 10'].toFixed(2)}</td>
                        <td>${totals['PSA 10'].toFixed(2)}</td>
                        <td>${totals['BGS 10'].toFixed(2)}</td>
                        <td>${totals['BGS 10 Black'].toFixed(2)}</td>
                        <td>${totals['CGC 10 Pristine'].toFixed(2)}</td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
            <div className="button-container">
                <button onClick={downloadCSV}>Download CSV</button>
                <button onClick={goHome}>Go Home</button>
            </div>
        </div>
    );
};

export default ResultsPage;
